import React,{useState} from "react";
import {BsChevronCompactLeft,BsChevronCompactRight} from 'react-icons/bs';
function Imageslider(){
  const slides = [
      {
          url:"https://static.toiimg.com/photo/msid-98479338/98479338.jpg"
          
      },
      {
          url:"https://files.prokerala.com/news/photos/imgs/1200/a-view-of-a-rangoli-with-colours-and-earthen-1463710.jpg"
          
      },
      {
          url:"data:image/jpeg;base64,"
          
      },
      {
          url:"data:image/jpeg;base64,"
          
      },
      {
          url:"data:image/jpeg;base64,"
          
      },
  
  ];
const [currentIndex,setCurrentIndex] = useState(0);

const preSlide = () => {
const isFirstSlide =currentIndex ===0;
const newIndex = isFirstSlide ? slides.length-1 : currentIndex-1;
setCurrentIndex(newIndex);
};
const nextSlide = () => {
  const isLastSlide =currentIndex === slides.length -1;
  const newIndex = isLastSlide ? 0 : currentIndex+1;
  setCurrentIndex(newIndex);
};
  
 return(
        
  <div className="max-w-[350px] h-[350px] w-full lg:block hidden m-auto py-16 px-4 relative group">
    <div className="text-3xl mb-5 text-bold">Bussiness categories</div>
    <div style={{backgroundImage:`url(${slides[currentIndex].url})`}} className="w-full h-full rounded-2xl bg-center bg-cover duration-500"></div>
  {/* left */}
  <div  className=" hidden group-hover:block absolute top-[50%] -translate-x-0 translate-y-[50%] left-5 text-2xl rounded-full p-2 bg-black/20 text-white cursor-pointer">
    <BsChevronCompactLeft onClick={preSlide} size={30}/>
  </div>
  {/* right */}
  <div className=" hidden group-hover:block absolute top-[50%] -translate-x-0 translate-y-[50%] right-5 text-2xl rounded-full p-2 bg-black/20 text-white cursor-pointer">
    <BsChevronCompactRight onClick={nextSlide} size={30}/>
  </div>
  </div>
  

 )
  };

export default Imageslider;
